import React from 'react';
import { BrowserRouter as Router, Roues, Route} from 'react-router-dom';
import './App.css';
import NavBar from "./Components/Pages/NavBar";

function App() {
  return (
    <Router>
        <NavBar />
        <Switch>
          <Route path ='/' />
        </Switch>
    </Router>
  );
}

export default App;
